import React from 'react';
import { Line } from 'react-chartjs-2';
import ReactDOM from "react-dom";

const data = {
  labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
  datasets: [
    {
      data: [12, 19, 3, 5, 2, 3],
      backgroundColor: [
        '#002C5F',
      ],
      borderColor: [
        '#002C5F',

      ],
      borderWidth: 1,
    },
  ],
};


//const myRef = React.createRef();
const lineOptions = {
    legend: {
        display: false,
      },
      scales: {
        xAxes: [{
          gridLines: {
            display: false,
          },
          ticks: {
            fontSize: 15,
            fontColor: 'lightgrey'
          }
        }],
        yAxes: [{
          gridLines: {
            drawBorder: false,
          },
          ticks: {
            beginAtZero: true,
            fontSize: 15,
            fontColor: 'lightgrey',
            maxTicksLimit: 5,
            padding: 25,
          }
        }]
      },
      tooltips: {
        backgroundColor: '#1e90ff'
      }
   
  };

const VerticalBar = () => (
  <>

    <Line data={data} options={lineOptions} />
  </>
);

export default VerticalBar;
